import React, { useEffect, useState } from 'react';

const flierUrls = [
  process.env.PUBLIC_URL + '/flier1.jpg',
  process.env.PUBLIC_URL + '/flier2.jpg',
  process.env.PUBLIC_URL + '/flier3.jpg', // Ensure this file exists
];

const Welcome = ({ onRegister, onAdmin }) => {
  const [slide, setSlide] = useState(0);
  const [transitioning, setTransitioning] = useState(false);

  // Slideshow logic with Murph transition (crossfade + scale)
  useEffect(() => {
    const timer = setInterval(() => {
      setTransitioning(true);
      setTimeout(() => {
        setSlide(s => (s + 1) % flierUrls.length);
        setTransitioning(false);
      }, 700); // transition duration
    }, 4000);
    return () => clearInterval(timer);
  }, []);

  return (
    <section className="page active" style={{position:'relative', overflow:'hidden', minHeight: '100vh', padding:0}}>
      {/* Flier slideshow background */}
      <div style={{
        position: 'fixed',
        top: 0, left: 0, width: '100vw', height: '100vh',
        zIndex: 0,
        pointerEvents: 'none',
        background: '#001f3f',
      }}>
        {flierUrls.map((url, i) => (
          <img
            key={i}
            src={url}
            alt={`Conference Flier ${i+1}`}
            style={{
              position: 'absolute',
              top: 0, left: 0, width: '100vw', height: '100vh', objectFit: 'cover',
              opacity: slide === i ? 1 : 0,
              transform: slide === i ? (transitioning ? 'scale(1.08)' : 'scale(1)') : 'scale(1.04)',
              transition: 'opacity 0.7s cubic-bezier(.4,2,.6,1), transform 0.7s cubic-bezier(.4,2,.6,1)',
              filter: 'brightness(0.85) blur(0.5px)',
            }}
          />
        ))}
      </div>
      {/* Content overlay */}
      <div style={{position:'relative', zIndex:1, paddingTop:80, paddingBottom:40, color:'#fff', textAlign:'center'}}>
        <h2 style={{fontSize:'2.7rem', fontWeight:900, textShadow:'0 2px 16px #001f3f', letterSpacing:1, fontFamily:'Montserrat, sans-serif'}}>Welcome to MDCAN BDM 042‑2025</h2>
        <p style={{fontSize:'1.3rem', fontWeight:700, margin:'18px 0 32px 0', textShadow:'0 2px 8px #001f3f88', fontFamily:'Montserrat, sans-serif'}}>
          <em>Otanisi Psychosis: The mental health implications of Nigeria's socio-economic shifts</em>
        </p>
        <ul style={{fontSize:'1.2rem', marginBottom:32, fontWeight:700, color:'#ffc107', textShadow:'0 2px 8px #001f3f88', display:'inline-block', background:'rgba(0,31,63,0.7)', borderRadius:12, padding:'1.2rem 2rem', fontFamily:'Montserrat, sans-serif'}}>
          <li>Medical migration syndrome: fortune and misfortunes</li>
          <li>Physician heal thyself: The mismatch between knowledge and practice</li>
        </ul>
        <div style={{textAlign:'center', marginTop:36}}>
          <button className="btn btn-success" style={{fontSize:'1.2rem', padding:'0.8rem 2.2rem', boxShadow:'0 2px 12px #28a74555'}} onClick={onRegister}>
            Register Now
          </button>
          <button className="btn btn-primary" style={{fontSize:'1.1rem', marginLeft:16, background:'#001f3f', color:'#fff', fontWeight:700, borderRadius:8, padding:'0.7rem 1.8rem', boxShadow:'0 2px 12px #001f3f33'}} onClick={onAdmin}>
            Admin
          </button>
        </div>
      </div>
      {/* Programme of Events moved to footer */}
      <footer style={{position:'fixed', left:0, bottom:0, width:'100vw', zIndex:2, background:'rgba(0,31,63,0.92)', color:'#fff', padding:'1.5rem 0 1.2rem 0', fontFamily:'Montserrat, sans-serif', fontWeight:700, fontSize:'1.1rem', boxShadow:'0 -2px 16px #001f3f55', overflowX:'auto'}}>
        <div style={{display:'flex', flexWrap:'wrap', justifyContent:'center', gap:32}}>
          <div className="event-card">
            <h3>Monday 1st Sept 2025</h3>
            <ul>
              <li>Arrival of NOC... all day</li>
              <li>NOC ‑ LOC Meeting .. 7 pm</li>
            </ul>
          </div>
          <div className="event-card">
            <h3>Tuesday 2nd Sept 2025</h3>
            <ul>
              <li>Courtesy visits.... all day</li>
              <li>Arrival of delegates... all day</li>
              <li>Medical outreach... all day</li>
              <li>Welcome, cocktail... 7 pm</li>
            </ul>
          </div>
          <div className="event-card">
            <h3>Wednesday 3rd Sept 2025</h3>
            <ul>
              <li>Registration 7 ‑ 8 am</li>
              <li>First Scientific session 8 ‑ 10:30 am</li>
              <li>Tea Break 10:30 ‑ 11 am</li>
              <li>Second session 11 am ‑ 12 noon</li>
              <li>Sub‑theme lecture 12 ‑ 1:30 pm</li>
              <li>Lunch 1:30 ‑ 2:30 pm</li>
              <li>NEC 1 3 ‑ 5 pm</li>
            </ul>
          </div>
          <div className="event-card">
            <h3>Thursday 4th Sept 2025</h3>
            <ul>
              <li>Registration 7 ‑ 8 am</li>
              <li>Third session 8 ‑ 9:30 am</li>
              <li>Tea Break 10 ‑ 11 am</li>
              <li>Opening Ceremony 11 am ‑ 1 pm</li>
